// Intercetta la chiamata GET reale del sito e fornisce una risposta mockata
cy.intercept('GET', '**/api/users**', {
  statusCode: 200,
  body: {
    page: 1,
    per_page: 6,
    total: 12,
    total_pages: 2,
    data: [{
      id: 999,
      email: 'mocked@user.com',
      first_name: 'Mocked',
      last_name: 'User'
    }]
  }
}).as('mockUsers');
// Visita la pagina Users API del sito QA Practice
cy.visit('https://qa-practice.razvanvancea.ro/api/users');
// Aspetta che la chiamata intercettata avvenga e verifica lo status
cy.wait('@mockUsers').then(interception => {
  expect(interception.response.statusCode).to.eq(200);
  // Controlla il contenuto mockato
  expect(interception.response.body.data[0]).to.deep.equal({
    id: 999,
    email: 'mocked@user.com',
    first_name: 'Mocked',
    last_name: 'User'
  });
});
// Optional: verifica che il mock sia visibile nel DOM
cy.get('body').should('contain.text', 'Mocked');
